import React, { Component } from "react";
import "../Styles/Welcome.css";

import { Container, Row, Col, Table } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

export default class Welcome extends Component {
  render() {
    return (
      <div>
        <Container>
          <Row>
            <Col xs={6} style={styles.col} sm={6}>
              <h1 class="mt-5 text-black">HANAA LIVRAISON</h1>
              <p class="mt-4 fs-4 text-black">
                {" "}
                Bienvenue sur notre site web.{" "}
              </p>
              <p class="mt-5 fs-6 text-black">
                {" "}
                Notre service vous propose la livraison des légumes et fruits
                partout en Rabat.{" "}
              </p>
              <p class=" fs-6 text-black">
                {" "}
                Notre équipe est à votre disposition pour vous faciliter vos
                courses.{" "}
              </p>
              <div class="mt-4"></div>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}
const styles = {
  grid: {
    paddingLeft: 0,
    paddingRight: 0,
  },
  row: {
    marginLeft: 0,
    marginRight: 0,
  },
  col: {
    paddingLeft: 0,
    paddingRight: 0,
  },
};
